llen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",jyc='Dimension',hkc='Dimension [height=',zuc='DirectionalTextHelper',Cuc='DockLayoutPanel',Duc='DockLayoutPanel$Direction',Euc='DockLayoutPanel$Direction;',Huc='DockLayoutPanel$DockAnimateCommand',Fuc='DockLayoutPanel$LayoutData',Mqc='DomEvent',Rqc='DomEvent$Type',Twc='Double',jhc='EAST',jbc='EEE, d MMM yyyy HH:mm:ss Z',anc='EEE. dd MMM. yyyy HH:mm:ss',jcc='EEEE MMMM d',Kcc='EEEE, MMMM d',Gcc='EEEE, MMMM d, y',fcc='EEEE, y MMMM dd',Q8b='EM',Sec='EMPTY',Xec='ENABLED',cdc='END',S8b='EX',htc='ElementMapperImpl',itc='ElementMapperImpl$FreeNode',Fcc='English',Zpc='Enum',wcc='Etc/GMT',ycc='Etc/GMT+',xcc='Etc/GMT-',f9b='Event type',Zvc='Event$NativePreviewEvent',crc='EventBus',opc='EventObject',tpc='Exception',Rfc='Expecting version 6 from server, got ',aac='F',jlc='F8834F07517EF3B7D02B9E845E5E1B
